(function(window, document, undefined) {
'use strict';
    let header = document.querySelector('.page-header');
    let logo = header.querySelector('.page-header__logotype');
    let logoIMG = header.querySelector('.page-header__logotype img'); 
    
    window.onscroll = function() {
        header.classList.add('page-header_scrolled');
        logo.classList.add('page-header__logotype_scrolled');
        logoIMG.src = "data:img/png;base64,";

        if (window.pageYOffset === 0) {
            header.classList.remove('page-header_scrolled');
            logo.classList.remove('page-header__logotype_scrolled');
            logoIMG.src = "data:img/png;base64,";
        };
        
      
        
    
}})(window, document, undefined);
